import React from 'react';
import {Link } from 'react-router-dom';
function Navbar(props) {
    
        return (
            <React.Fragment> 
            <div className="navbar navbar-expand-lg bg-dark d-flex">
                <a className="navbar-brand" href="logo"> Title </a>  
                <div className="navbar-nav ml-auto mr-0">                    
                       <Link to="/about" className="navbar-link p-1 "> About </Link> 
                       <a href="item" className="navbar-link p-1">  Contacto</a> 
                       <a href="item" className="navbar-link p-1">  Trabajo</a> 
                    </div>  
            </div>
            {props.chidren}
            </React.Fragment>

        )
    
}


export default Navbar;
